import React, { Suspense } from 'react';
import './App.css';
import SongCard from './component/songcard/song_card_component.js'
import { fetchGenreData } from './request/fetch_info/fetch_genre_data'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Navbar from './component/navbar/navbar_component'
import ToggleSwitchBar from './component/toggleswitchbar/toggleswitchbar_component'
import ControlBar from './component/controlbar/controlbar_component.js'
import ContentPaneContainer from './component/contentpanecontainer/content_pane_container'
import Listview from './component/listview/listview_component'
import {app_search_context, search_paradigms} from './context/app/app_search_context'
const resource = fetchGenreData();

class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      search_paradigm: search_paradigms.album
    }; 
  }

  render(){
  return (
    <> 
    <Router>
      <div>
      <Navbar/>
      <Switch>
        <Route path='/' exact />
      </Switch>
      </div>
      <div>
      <app_search_context.Provider value={this.state}>
      <ToggleSwitchBar />
      </app_search_context.Provider></div>
    </Router>
    <div className="ContentPane"> 
      <ContentPaneContainer/>
    </div>
    </> 
  )};

}

